export default function Card(props) {
   return (
      <div style={{
         width: '200%',
         position: "relative"
      }}>
         <button onClick={props.onClose}>X</button>
         <img src={props.image} alt='' />
         <h2>{props.name}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.origin}</h2>
      </div>
   );
}
